      out.write("\t\t\t\t<p>Common\r\n");
      out.write("\t\t\t\t\tSense（简称CMSS），相信对于关注街头潮流的你，不会不熟悉这个名字的新定义。对的，现在是余文乐的个人品牌。 概念 CMSS\r\n");
      out.write("\t\t\t\t\tCMSS(5张) Common\r\n");
      out.write("\t\t\t\t\tSense（简称CMSS）的品牌概念一直很模糊，或者说是有点故弄玄虚的暧昧感的宣传方式。虽然Common\r\n");
      out.write("\t\t\t\t\tSense（简称CMSS）的消息出来有一段时间了，但是很多具体的细节都没有浮面。大家靠的只能是猜测。只知道从EAST\r\n");
      out.write("\t\t\t\t\tTOUCH的余文乐个人专栏Common Sense开始，不断介绍一些个人的爱好为主。\r\n");
      out.write("\t\t\t\t\t甚至是一个完整的品牌那样按系列推出，还是以单品推出为主的形式也不太清楚。当然CatWhy更愿意看到是后者那种形式。\r\n");
      out.write("\t\t\t\t\t风格虽然Common\r\n");
      out.write("\t\t\t\t\tSense（简称CMSS）只是发布了几款产品的谍照而已，不过可以看出这些产品的设计风格还是很符合余文乐个人的喜好的。基本都已很basic的款式为主，然后在其细节上花功夫。\r\n");
      out.write("\t\t\t\t\t其实目前看来，Common Sense（简称C\r\n");
      out.write("\t\t\t\t\tMSS）确实更似用来直接传达余文乐的个人审美。从初步曝光的产品中看到，只算是加上了Common\r\n");
      out.write("\t\t\t\t\tSense或CMSS的logo为主，没有太大的设计可言。与其入手余文乐的“Common Sense”，不如制作属于自己的“Common\r\n");
      out.write("\t\t\t\t\tSense”更好，这样来得更有共鸣感。\r\n");
      out.write("\t\t\t\t\t你可以到布料市场或者网上寻找能够表达自己sense的绣章或者一些简单的加工设计，缝到自己的喜欢的素体服饰上就好。我始终认为，衣服除了好看以外，更多是寻找自己的共鸣感。这也是笔者OneTwo很喜欢街头潮流的原因，大家都在坚持实现自己的理念。</p>\r\n");
