      out.write("\t\t\t</div>\r\n");
      out.write("\t\t\t<div class=\"p2\">\r\n");
      out.write("\t\t\t\t<p>CLOT是香港著名艺人陈冠希创办的凝结集团（CLOT\r\n");
      out.write("\t\t\t\t\tFAMILY）的简称及该公司旗下潮流服装品牌名称。凝结集团是一个LIFESTYLE的公司，由香港著名艺人陈冠希创办于2003年6月。主要以创作服装（包括CLOT品牌服装以及在香港的JUICE店铺）、策划PARTY、帮助服装公司做Consultant等。CLOT品牌服装是中国第一潮牌，在全球潮流品牌中占有一席之地。Edison陈冠希2003年创办了自己的服装品牌CLOT，并自己参与服装的设计、用料等各个方面，成为中国第一潮牌，并在世界上都有一定的影响力。CLOT是一个LIFESTYLE的公司，创作服装，包括CLOT品牌服装以及在香港的JUICE店铺、策划PARTY、帮助香港一些公司做consultant，例如NIKE、PEPSI…、更包括CLOT自己的音乐，现成员包括：陈冠希、MC仁、、DJTommy、厨房仔、恭硕良、赵晨浩、BOSS（环球热力兄弟）等一起，CLOT是一个FAMILY，是一个不可分开的家庭。而他的店铺JUICE也成为香港游客的一旅游胜地CLOT也经常会与一些其他大品牌生产合作产品，像LEⅥ'S，NIKE，PEPSI等品牌。前段时间Edison在上海长乐路开了自己第二家CLOT店ACU（由于租期问题，现已由李晨的NPC代替）\r\n");
      out.write("\t\t\t\t\t第一家在香港 ACU开店当天的情况 可谓盛况空前 各大明星潮人都出现在ACU藤原浩等等。与Nike的合作，鞋款的Nick\r\n");
